class DocBase {
    constructor() {
        // --- CONFIGURAÇÃO CENTRAL DE LOGOS (Base64) ---
        // Cole o código Base64 das logos aqui.
        this.logosMunicipios = {    
            "CONDE": "",
            "SANTA RITA": "data:image/jpeg;base64,",
        };

        // --- IMAGENS DE FUNDO (Full Page) ---
        // Agora ambas funcionam como folha inteira (A4)
        this.base64Watermark = "data:image/jpeg;base64,"; 
        this.base64BgSecretario = "data:image/png;base64,";  // Fundo para Termo de Lote (Secretário)
    }

    checkLib() {
        if (!window.jspdf) { alert("Biblioteca jsPDF não carregada!"); return false; }
        if (!window.jspdf.jsPDF.API.autoTable) { alert("Plugin AutoTable não carregado!"); return false; }
        return true;
    }

    getLogoForCity(city) {
        if (!city) return this.logosMunicipios["PADRAO"];
        const cityKey = city.toUpperCase().trim();
        return this.logosMunicipios[cityKey] || this.logosMunicipios["PADRAO"];
    }

    // Função unificada: Sempre adiciona como Página Inteira (Fundo)
    addWatermark(doc, imageBase64, isFullPage = true) {
        if (!imageBase64) return;
        
        const pageWidth = doc.internal.pageSize.getWidth();
        const pageHeight = doc.internal.pageSize.getHeight();
        
        try {
            // Agora desenha sempre ocupando a folha toda (0,0 -> w,h)
            // Se precisar de transparência em algum caso específico, podemos ajustar,
            // mas para fundos de papel timbrado geralmente é sem opacidade (ou a imagem já é clara).
            doc.addImage(imageBase64, 'PNG', 0, 0, pageWidth, pageHeight);
        } catch (e) { 
            console.error("Erro ao adicionar marca d'água:", e); 
        }
    }
}